    def __init__(self):
        self.planeImage = None

    def _hsv2rgb(self, hsv:tuple) -> tuple:
        ''' converts hsv tuple into rgb color '''
        h,s,v = hsv
        
        h8 = h*8
        hi = int(h8)
        f  = h8 - hi
        
        p  = v * (1.0 - s)
        q  = v * (1.0 - s * f)
        t  = v * (1.0 - s * (1.0 - f))
        
        if (hi == 0):
            r = v
            g = t
            b = p
        elif (hi == 1):
            r = q
            g = v
            b = p
        elif (hi == 2):
            r = p
            g = v
            b = t
        elif (hi == 3):
            r = p
            g = q
            b = v
        elif (hi == 4):
            r = t
            g = p
            b = v
        else:
            r = v
            g = p
            b = q
        
        return [r,g,b]

    def _process_image(self, image, scale, angle, hsv):
        ''' rotate and scale image and give it a color '''
        H, W = image.shape[:2]
        center = (W/2, H/2)

        alt,sat,val  = hsv
        hue = np.fmod(alt/12 + 0.25, 0.75)
        col = self._hsv2rgb((hue,sat,val))

        M = cv2.getRotationMatrix2D(center, -angle, scale)
        img = cv2.warpAffine(image, M, dsize=(W, H))
        img_out = np.zeros((*img.shape[:2], 4))
        img_out[:,:,:3] = cv2.cvtColor(img[:,:,0], cv2.COLOR_GRAY2RGB) * col
        img_out[:,:,3] = img[:,:,1]

        return np.clip(img_out, 0, 255).astype(np.uint8)

    def getIcon(self, flight, size, alt=12.0, s=1.5, v=1.25):
        '''
        Retrieve proper aircraft icon according to flight attributes. Needs correct sprites map already loaded.
        
        @param flight the flight object
        @param size the requested icon magnification
        @param altitude the color of the aircraft ('R':6.0, 'B':12.0, or 'Y':7.25)
        
        @return the ImageTK PhotoImage of the icon
        '''
        # find proper aircraft
        cfg_ = None
        aircraft_code = flight.aircraft_code

        if aircraft_code in self.SPRITES:
            cfg_ = self.SPRITES[aircraft_code]
        else:
            for aircraft in self.SPRITES:
                if aircraft_code in self.SPRITES[aircraft]['aliases']:
                    cfg_ = self.SPRITES[aircraft]
                    break
        # not found, use default image
        if cfg_ is None:
            aircraft_code = "C206"
            if aircraft_code in self.SPRITES:
                cfg_ = self.SPRITES[aircraft_code]
            else:
                for aircraft in self.SPRITES:
                    if aircraft_code in self.SPRITES[aircraft]['aliases']:
                        cfg_ = self.SPRITES[aircraft]
                        break
            if cfg_ is None:
                return None
        
        # get heading index
        angle = flight.heading
        if aircraft_code in self.NO_ROTATE:
            angle = 0

        scale = size/80
        image = Image.open(BytesIO(cfg_['images'][0]))
        img = self._process_image(np.array(image), scale, angle, (alt, s, v))

        self.planeImage = ImageTk.PhotoImage(Image.fromarray(img))
        return self.planeImage
